result:
.el-divider--horizontal {
  margin: 0;
}

.container {
  .title {
    height: 59px;
    line-height: 59px;
    color: $parent-title-color;
    font-size: 16px;
    font-weight: 500;
    text-indent: 40px;

    .back {
      float: right;
      margin-right: 40px;
      cursor: pointer;
    }
  }

  .wrap {
    padding: 20px;
  }

  .submit {
    float: left;
  }

  .image-preview-container {
    position: relative;

    .preview-button {
      position: absolute;
      right: 0;
      top: 0;
      background-color: rgba(255, 255, 255, 0.8);
      border-radius: 4px;
      padding: 5px 10px;
      z-index: 2;
      transition: all 0.3s;

      &:hover {
        background-color: rgba(64, 158, 255, 0.1);
      }
    }
  }
}
